[{"fields": {"modified_date": "2015-08-10T02:49:55.575Z", "modified_by": 1, "admin_note": "", "title": "Partials > Footer", "custom_template": "{% load staticfiles i18n helpful_tags core_tags cache %}
<footer id="footer">
    <div class="container" itemscope itemtype="http://schema.org/LocalBusiness">
        
        {% cache 86400 'site-menu-footer' %}  
        {% get_link_descendants "footer-menu" as footerlinks %}
        <ul class="footer-links debug-item {{footerlinks.css_classes}}" {{footerlinks.item|edit_attribute}} >
