                <a href="{% url_add_query page=page_obj.previous_page_number %}" aria-label="Previous">
                    <span aria-hidden="true">&laquo;</span>
                </a>
            </li>
        {% endif %}

       
        {% pick_pages page_obj.paginator.num_pages page_obj.number as pagination_range %}
        {% for i in pagination_range %}

            {% if i %}
            <li {% if page_obj.number = i %}class="active"{% endif %}>
                <a href="{% url_add_query page=i %}">{{i}}</a>
            </li>    
            {% else %}
            <li class="inactive">&hellip;</li>    
            {% endif %}
        {% endfor %}  


        {% if page_obj.has_next %}
