    <ol class="breadcrumb">
    {% for page in hierarchy %}
        {% if forloop.first %}
        
        {% elif forloop.last %}
        <li class="last">{{page.title}}</li>
        {% else %}
        <li><a href="{{page.get_absolute_url}}" {% if forloop.last %}class="last"{% endif %}>{{page.title}}</a></li>
        {% endif %}
    {% endfor %}
    </ol>
{% endif %}
{% endwith %}
{% endcomment %}

{% endblock %}


{% block title %}{{object.title}}{% endblock %}

